    if vdd not in vdd_lst:
        raise ValueError(f"invalid vdd, valid list: {vdd_lst}")
    
    body_vth = PMOS_vdd_map[vdd]
    for body_i, vth_i in body_vth:
        if vbody <= body_i:
            return abs(vth_i)
    raise LookupError("excessive vbody")

